CKEDITOR.plugins.setLang("a11yhelp","nb",{title:"Instruksjoner for tilgjengelighet",contents:"Innhold for hjelp. Trykk ESC for  lukke denne dialogen.",legend:[{name:"Generelt",items:[{name:"Verktylinje for editor",legend:"Trykk ${toolbarFocus} for  navigere til verktylinjen. Flytt til neste og forrige verktylinjegruppe med TAB og SHIFT-TAB. Flytt til neste og forrige verktylinjeknapp med HYRE PILTAST og VENSTRE PILTAST. Trykk MELLOMROM eller ENTER for  aktivere verktylinjeknappen."},{name:"Dialog for editor",
legend:"Mens du er i en dialog, trykk TAB for  navigere til neste dialogfelt, press SHIFT + TAB for  flytte til forrige felt, trykk ENTER for  akseptere dialogen, trykk ESC for  avbryte dialogen. For dialoger med flere faner, trykk ALT + F10 for  navigere til listen over faner. G til neste fane med TAB eller HYRE PILTAST. G til forrige fane med SHIFT + TAB eller VENSTRE PILTAST. Trykk MELLOMROM eller ENTER for  velge fanen."},{name:"Kontekstmeny for editor",legend:"Trykk ${contextMenu} eller MENYKNAPP for  pne kontekstmeny. G til neste alternativ i menyen med TAB eller PILTAST NED. G til forrige alternativ med SHIFT+TAB eller PILTAST OPP. Trykk MELLOMROM eller ENTER for  velge menyalternativet. pne undermenyen p valgt alternativ med MELLOMROM eller ENTER eller HYRE PILTAST. G tilbake til overordnet menyelement med ESC eller VENSTRE PILTAST. Lukk kontekstmenyen med ESC."},
{name:"Listeboks for editor",legend:"I en listeboks, g til neste alternativ i listen med TAB eller PILTAST NED. G til forrige alternativ i listen med SHIFT + TAB eller PILTAST OPP. Trykk MELLOMROM eller ENTER for  velge alternativet i listen. Trykk ESC for  lukke listeboksen."},{name:"Verktylinje for elementsti",legend:"Trykk ${elementsPathFocus} for  navigere til verktylinjen som viser elementsti. G til neste elementknapp med TAB eller HYRE PILTAST. G til forrige elementknapp med SHIFT+TAB eller VENSTRE PILTAST. Trykk MELLOMROM eller ENTER for  velge elementet i editoren."}]},
{name:"Kommandoer",items:[{name:"Angre",legend:"Trykk ${undo}"},{name:"Gjr om",legend:"Trykk ${redo}"},{name:"Fet tekst",legend:"Trykk ${bold}"},{name:"Kursiv tekst",legend:"Trykk ${italic}"},{name:"Understreking",legend:"Trykk ${underline}"},{name:"Link",legend:"Trykk ${link}"},{name:"Skjul verktylinje",legend:"Trykk ${toolbarCollapse}"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},
{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:"Hjelp for tilgjengelighet",legend:"Trykk ${a11yHelp}"}]}]});
